def _hilbert_rotation(n, x, y, rx, ry):
    if (ry == 0):
        if (rx == 1):
            x = n - 1 - x
            y = n - 1 - y
        t = x
        x = y
        y = t
    return x, y

def hilbert_curve(n, x, y):
    rx, ry, d = 0, 0, 0
    s = n // 2
    while (s > 0):
        rx = (x & s) > 0
        ry = (y & s) > 0
        d += s * s * ((3 * rx) ^ ry)
        x,y = _hilbert_rotation(n, x, y, rx, ry)
        s = s // 2
    return d

def create_table(n):
    """Return a mapping of the unit square with resolution of (n x n) to the interval [0,1]. formally, it returns a
    definite monotonous function f: [0,1] x [0,1] --> [0,1]
    :param n - The resolution of the discrimination
    :return dictionary of {(x,y) : val in [0,1]}
    """
    x_ = np.array([i for i in range(n)])
    y_ = np.array([i for i in range(n)])
    curve = []
    for x, y in zip(x_, y_):
        curve.append(hilbert_curve(n, x, y))
    x_ = x_ / n
    y_ = y_ / n
    curve = np.array(curve) / np.max(curve)
    return dict(zip([(x,y) for x,y in zip(x_,y_)], curve))